import * as React from 'react';
import { ClimbingBoxLoader } from 'react-spinners';

const Loader = props => {
  return (
    <ClimbingBoxLoader
      sizeUnit={'px'}
      size={150}
      color={'#007fff'}
      {...props}
    />
  );
};

export default Loader;
